import React from 'react'

function Post() {
    return (
        <div>
            <h3>Username</h3>
            {/* header -> avatar + username */}
            <img className="post_image" src="https://www.freecodecamp.org/news/content/images/size/w2000/2020/02/Ekran-Resmi-2019-11-18-18.08.13.png" alt=""/>
            {/* image */}
        </div>
    )
}

export default Post;
